import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import AccountPage from "../pages/AccountPage/AccountPage";
import AppointmentPage from "../pages/Citas/AppointmentPage";
import CartPage from "../pages/CartPage";
import HomePage from "../pages/HomePage/HomePage";
import LoginPage from "../pages/Login/LoginPage";
import RegisterPage from "../pages/RegisterPage";
import AnimalsPage from "../pages/AnimalsPage";
import NotFoundPage from "../pages/NotFoundPage";
import Layout from "../layouts/Layout";
import ProductsPage from "../pages/ProductsPage/ProductsPage";
import AdminPage from "../pages/Admin/AdminPage";
import PrivateRoute from "./PrivateRoute";
import AccountPageCita from "../pages/AccountPage/AccountPageCita";
import UserLayout from "../layouts/UserLayout";
import Sidebar from "../pages/AccountPage/Sidebar";

const AppRouter = () => {
  return (
    <Router>
      <Layout>
        <Switch>
          <Route exact path="/" component={HomePage} />
          <Route exact path="/registro" component={RegisterPage} />
          <Route exact path="/login" component={LoginPage} />
          <PrivateRoute exact path="/cuenta" component={Sidebar} />
          {/* <UserLayout> */}
          {/* <PrivateRoute
            exact
            path="/cuenta/citass"
            component={AccountPageCita}
          /> */}
          {/* </UserLayout> */}
          <Route exact path="/cita" component={AppointmentPage} />
          <Route exact path="/carrito" component={CartPage} />
          <Route exact path="/adquisicion" component={AnimalsPage} />
          <Route exact path="/productos" component={ProductsPage} />
          <PrivateRoute exact path="/admin" component={AdminPage} />

          <Route exact path="*" component={NotFoundPage} />
        </Switch>
      </Layout>
    </Router>
  );
};

export default AppRouter;
